import React from 'react';
import ReactDOM from 'react-dom/client';
import './styles/reset.css';
import { Provider } from './Context';
import App from './App';

ReactDOM.render(
  <Provider>
    <App />
    <h1>Hello</h1>
  </Provider>,
  document.getElementById('root'));
